export default function Footer() {
  return (
    //i want to make a icons that will link to my Github, LinkedIn, StackOverflow thats styled with tailwind and styled with styled components
    <div className="flex justify-center">
      <a
        href="
        https://github.com/HacAtac/hac-portfolio " //link to my github
        target="_blank"
        rel="noopener noreferrer"
      >
        <i className="fab fa-github-square fa-2x"></i>
      </a>
      <a
        href="https://www.linkedin.com/in/jordan-hackworth-898205217/" //link to my linkedin
        //class or id for #favicon
        class="favicon"
        target="_blank"
        rel="noopener noreferrer"
      >
        <i className="fab fa-linkedin fa-2x"></i>
      </a>
      <a
        href="https://stackoverflow.com/users/16417931/hac-atac" //link to my stackoverflow
        target="_blank"
        rel="noopener noreferrer"
      >
        <i className="fab fa-stack-overflow fa-2x"></i>
      </a>
    </div>
  );
}

